<icon BUILTIN="messagebox_warning"/>
<node TEXT="1:45:50 teze nesou skrytou informaci" ID="ID_1052381278" CREATED="1477188398967" MODIFIED="1477189621320"/>
<node TEXT="nad ka&#x17e;dou informac&#xed; je nutn&#xe9; meditovat" ID="ID_1077333653" CREATED="1477189621910" MODIFIED="1477189639784"/>
<node TEXT="1. V&#x161;e, co existuje, m&#xe1; v t&#x159;et&#xed; dimenzi dvoj&#xed; tv&#xe1;&#x159;." ID="ID_609510960" CREATED="1477189500648" MODIFIED="1477189536481"/>
<node TEXT="2. Tyto dv&#x11b; tv&#xe1;&#x159;e se v&#x17e;dy vz&#xe1;jemn&#x11b; pozoruj&#xed; a ovliv&#x148;uj&#xed;." ID="ID_994055491" CREATED="1477189515816" MODIFIED="1477189560656"/>
<node TEXT="3. V&#x161;e, co exituje ve t&#x159;et&#xed; dimenzi, m&#xe1; sv&#x16f;j osobit&#xfd; d&#x16f;vod k existenci. Tento d&#x16f;vod m&#xe1; tak&#xe9; dv&#x11b; tv&#xe1;&#x159;e a m&#xe1; sv&#x16f;j z&#xe1;m&#x11b;r, kter&#xfd; realizuje. A i tento z&#xe1;m&#x11b;r m&#xe1; dv&#x11b; tv&#xe1;&#x159;e." ID="ID_101809063" CREATED="1477189562295" MODIFIED="1477189758752"/>
<node TEXT="4. V&#x161;e, co existuje, je projevem s&#xed;ly. Je nekone&#x10d;n&#xe9; mno&#x17e;stv&#xed; sil a ka&#x17e;d&#xe1; z nich je tak&#xe9; dvoj&#xed; tv&#xe1;&#x159;e." ID="ID_411932817" CREATED="1477189759550" MODIFIED="1477189832142"/>
<node TEXT="5. Ka&#x17e;d&#xe1; s&#xed;la je neomezen&#xe1; ve sv&#xe9; svobod&#x11b; projevu a sv&#xfd;ch z&#xe1;m&#x11b;rech a zp&#x16f;sobu jejich realizace." ID="ID_566860504" CREATED="1477189832772" MODIFIED="1477189870654"/>
<node TEXT="6. I lidsk&#xe1; bytost je projevem s&#xed;ly o dvou tv&#xe1;&#x159;&#xed;ch. Ta prvn&#xed; se jmenuje &#x17e;ivot a ta druh&#xe1; smrt. Ta prvn&#xed; je tvo&#x159;itel a ta druh&#xe1; ni&#x10d;itel." ID="ID_1795047100" CREATED="1477189871076" MODIFIED="1477189938941"/>
<node TEXT="7. Ka&#x17e;d&#xe1; lidsk&#xe1; bytost je tedy tvo&#x159;itel a ni&#x10d;itel z&#xe1;rove&#x148;." ID="ID_1833760934" CREATED="1477189939420" MODIFIED="1477189972557"/>
<node TEXT="8. Evoluce je zp&#x16f;sob nasm&#x11b;rov&#xe1;n&#xed; kreativn&#xed; s&#xed;ly o dvou tv&#xe1;&#x159;&#xed;ch. V&#x161;e, co tvo&#x159;&#xed;, rotuje. A v t&#xe9;to rotaci se st&#x159;&#xed;daj&#xed; tak&#xe9; dv&#x11b; tv&#xe1;&#x159;e. Jedna z nich se naz&#xfd;v&#xe1; synergie a druh&#xe1; pak entropie." ID="ID_361063102" CREATED="1477189973187" MODIFIED="1477190083725"/>
<node TEXT="9. Vzhledem k tomu, &#x17e;e v&#x161;echno, co existuje, samo o sob&#x11b; tvo&#x159;&#xed; a tak vyv&#xed;j&#xed; se, potom i rotuje. Rotace v rozm&#x11b;ru &#x10d;asu plod&#xed; cykly. Ka&#x17e;d&#xe1; rotace tvo&#x159;&#xed; sama o sob&#x11b; v&#xed;r a tento v&#xed;r je specifick&#xfd;m projevem dal&#x161;&#xed; s&#xed;ly. A i tato dal&#x161;&#xed; s&#xed;la m&#xe1; dv&#x11b; tv&#xe1;&#x159;e. Jedna z nich se jmenuje magnetick&#xe1; p&#x159;ita&#x17e;livost a druh&#xe1; pak izolace." ID="ID_1858204886" CREATED="1477190084498" MODIFIED="1477227011766"/>
<node TEXT="10. Je-li magnetick&#xe1; p&#x159;ita&#x17e;livost pod vlivem synergie, vznik&#xe1; to, &#x10d;emu lid&#xe9; &#x159;&#xed;kaj&#xed; l&#xe1;ska. Je-li v&#x161;ak pod vlivem druh&#xe9; tv&#xe1;&#x159;e, zvan&#xe9; entropie, vznik&#xe1; nen&#xe1;vist. Je-li izolace pod vlivem synergie, vznik&#xe1; stav osvobozuj&#xed;c&#xed; samoty. Je-li v&#x161;ak pod vlivem druh&#xe9; tv&#xe1;&#x159;e, tzv. entropie, vznik&#xe1; stav bolestn&#xe9;ho osam&#x11b;n&#xed;." ID="ID_1077901141" CREATED="1477227012715" MODIFIED="1477227224489"/>
<node TEXT="11. Nic nen&#xed; dobr&#xe9; a nic nen&#xed; &#x161;patn&#xe9;, ale v&#x161;e m&#xe1; sv&#x16f;j &#xfa;&#x10d;el a to je podstatn&#xe9;." ID="ID_1237304844" CREATED="1477227224915" MODIFIED="1477227255307"/>
<node TEXT="12. Prvn&#xed; kl&#xed;&#x10d; k tajemstv&#xed; v&#x161;ech tajemstv&#xed; spo&#x10d;&#xed;v&#xe1; v pochopen&#xed; toho, &#x17e;e d&#x16f;sledek nen&#xed; podstatn&#xfd;, &#x17e;e p&#x159;&#xed;&#x10d;ina nen&#xed; podstatn&#xe1;, ale &#xfa;&#x10d;el je svat&#xfd; a osvobozuj&#xed;c&#xed;." ID="ID_1127909350" CREATED="1477227256873" MODIFIED="1477227343467"/>
<node TEXT="13. Prvn&#xed;ho zrychlen&#xed; ve sv&#xe9;m nekone&#x10d;n&#xe9;m v&#xfd;voji, m&#x16f;&#x17e;e lidsk&#xe1; bytost dos&#xe1;hnout pochopen&#xed;m &#xfa;&#x10d;elu sv&#xe9; inkarnace." ID="ID_1228669449" CREATED="1477227343896" MODIFIED="1477227399793"/>
<node TEXT="14. Druh&#xe9;ho zrychlen&#xed; ve sv&#xe9; evoluci m&#x16f;&#x17e;e lidsk&#xe1; bytost dos&#xe1;hnout pochopen&#xed;m &#xfa;&#x10d;elu sv&#xe9; duchovn&#xed; existence." ID="ID_192102712" CREATED="1477227400599" MODIFIED="1477227495361"/>
<node TEXT="15. T&#x159;et&#xed;ho zrychlen&#xed; ve sv&#xe9; evoluci m&#x16f;&#x17e;e lidsk&#xe1; bytost dos&#xe1;hnout pochopen&#xed;m tzv. prvotn&#xed;ho &#xfa;&#x10d;elu bytosti lidsk&#xe9; v t&#xe9;ho galaxii." ID="ID_1886118599" CREATED="1477227496478" MODIFIED="1477228060732"/>
<node TEXT="16. Jakmile dos&#xe1;hne&#x161; t&#x159;et&#xed;ho zrychlen&#xed; ve sv&#xe9;m v&#xfd;voji, p&#x159;estane&#x161; b&#xfd;t b&#xfd;t projevenou silou v&#xfd;konnou, ale posv&#x11b;t&#xed;&#x161; svou existenci t&#xed;m, &#x17e;e se stane&#x161; projevenou silou &#x159;&#xed;d&#xed;c&#xed;." ID="ID_1630821434" CREATED="1477227558262" MODIFIED="1477228069628"/>
<node TEXT="17. Nikdy nic nebylo a nikdy nic nebude, proto&#x17e;e v&#x161;e, co je, je nyn&#xed;." ID="ID_653027358" CREATED="1477227670348" MODIFIED="1477228078051"/>
<node TEXT="18. V&#x161;echno lze zm&#x11b;nit, a proto milost nemus&#xed; existovat. Jedinou mo&#x17e;nou formou skute&#x10d;n&#xe9;ho projevu milosti je existence sama o sob&#x11b;. O milost je zbyte&#x10d;n&#xe9; prosit &#x10d;i &#x17e;&#xe1;dat a milost je zbyte&#x10d;n&#xe9; poskytovat. Je toti&#x17e; pevnou sou&#x10d;&#xe1;st&#xed; lidsk&#xe9; existence, jako jak&#xe9;koliv jin&#xe9; s&#xed;ly, v ka&#x17e;d&#xe9; vte&#x159;in&#x11b; jej&#xed;ho projevu." ID="ID_1827288520" CREATED="1477227708388" MODIFIED="1477228087260"/>
<node TEXT="19. V&#x161;echno lze zm&#x11b;nit, a proto jak&#xfd;koliv stav viny nemus&#xed; existovat. Jedinou mo&#x17e;nou formou skute&#x10d;n&#xe9;ho projevu viny je existence samotn&#xe9; evoluce a s n&#xed; spojen&#xe1; nutnost v&#xfd;voje." ID="ID_197401379" CREATED="1477227862371" MODIFIED="1477228092675"/>
<node TEXT="20. V&#x161;echno lze zm&#x11b;nit, a proto vytv&#xe1;&#x159;en&#xed; pot&#x159;eby nad&#x11b;je nemus&#xed; existovat. Jedinou mo&#x17e;nou formou skute&#x10d;n&#xe9;ho projevu nad&#x11b;je je existence samotn&#xe9;ho Byt&#xed; a s n&#xed;m spojen&#xe1; nutnost v&#x161;udep&#x159;&#xed;tomn&#xe9; a p&#x159;etrv&#xe1;vaj&#xed;c&#xed; moudrosti." ID="ID_1098272763" CREATED="1477227949818" MODIFIED="1477228099411"/>
</node>
